  const [counter, setCounter] = useState(0)

  useEffect(()=> {
    console.log('hello');
  })



  return (
    <div className="app">
        <h1>Hello</h1>
        <form className="form">
          <input type="text" className="search-bar" />
          <button type="submit" className="search-btn" onClick={setCounter(counter+1)}>{counter} </button>
        </form>
    </div>
  )
}

export default App
